function filterItems()
local customItems = {2234, 2238}

  for id, it in pairs(items) do
    local itemType = g_things.getThingType(id, 0)

    local item = Item.create(itemType:getId())
    local createdItemMarketData = itemType:getMarketData()

    if isInArray(customItems, it.serverId) or (not table.empty(createdItemMarketData) and createdItemMarketData.name ~= "") then
      it.clientId = id
      table.insert(QuickLootItems, it)
    end

  end

	table.sort(QuickLootItems, function(a, b) return a.name:upper() < b.name:upper() end)

  return QuickLootItems
end

function fillCorpses()
  for _, corpse in pairs(corpses) do
    table.insert(QuickLootCorpses, corpse)
  end

  return QuickLootCorpses
end

function getQuickLootItems()
  if table.empty(QuickLootItems) then
    return filterItems()
  end

  return QuickLootItems
end

function getQuickLootCorpses()
  if table.empty(QuickLootCorpses) then
    return fillCorpses()
  end

  return QuickLootCorpses
end
